(75, 21, 'Tour An Giang', 'Sinh thái', 2000000, '30', 25, 10, 'Khám phá An Giang, vùng đất tâm linh và văn hóa đặc sắc với những thắng cảnh nổi bật như núi Sam, miếu Bà Chúa Xứ, chùa Hang và rừng tràm Trà Sư. Du khách sẽ được trải nghiệm không khí linh thiêng, phong cảnh hoang sơ cùng văn hóa giao thoa giữa người Kinh, Chăm và Khmer. Tour thích hợp cho du lịch tâm linh, nghỉ dưỡng và tìm hiểu vùng sông nước miền Tây.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: An giang\r\nNgày 2: ', 1, 'Theo đoàn', '2 ngày 1 đêm', 0, 'Xe khách', 'Nam'),
(76, 26, 'Tour Anh Quốc', 'Hiện đại', 13000000, '20', 30, 10, 'Tour đưa bạn đến những thành phố nổi tiếng như London, Oxford, Manchester với cung điện Buckingham, tháp Big Ben, cầu Tháp London và vùng nông thôn cổ kính. Trải nghiệm nét văn hóa quý tộc xen lẫn hiện đại, tham quan bảo tàng Anh, thưởng thức trà chiều kiểu hoàng gia và hòa mình vào nhịp sống văn minh Châu Âu.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: London\r\nNgày 2:Oxford, Manchester\r\nNgày 3: Điện Buckingham, tháp Big Ben, cầu Tháp London và vùng nông thôn cổ kính', 1, 'Theo đoàn', '3 ngày 2 đêm', 12500000, 'Máy bay', 'Ngoài nước'),
(77, 24, 'Tour Úc', 'Hiện đại', 19000000, '20', 40, 10, 'Hành trình khám phá Sydney với Nhà hát Con Sò, cầu cảng Sydney, đến Melbourne cổ điển và dạo quanh đảo Kangaroo hoặc rạn san hô Great Barrier. Tour đưa bạn đến với thiên nhiên hùng vĩ, động vật hoang dã và lối sống phóng khoáng của người Úc. Phù hợp cho gia đình và những ai yêu thích không gian mở.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:Sydney với Nhà hát Con S\r\nNgày 2:Melbourne cổ điển và dạo quanh đảo Kangaroo hoặc rạn san hô Great Barrier', 1, 'Theo đoàn', '2 ngày 1 đêm', 0, 'Máy bay', 'Ngoài nước'),
(78, 25, 'Tour Cần Thơ', 'Sinh thái', 1500000, '30', 25, 10, 'Cần Thơ mang đậm nét văn hóa sông nước với chợ nổi Cái Răng sôi động từ sáng sớm, bến Ninh Kiều thơ mộng và các vườn trái cây trĩu quả. Bạn sẽ được đi thuyền, thưởng thức đặc sản miền Tây và trải nghiệm cuộc sống của người dân miền sông nước mộc mạc, chân thành.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Gia đình', '2 ngày 1 đêm', 0, 'Xe khách', 'Tây'),
(79, 29, 'Tour Cát Bà', 'Sinh thái', 2000000, '30', 12, 5, 'Cát Bà nổi bật với những bãi biển xanh ngọc, rừng quốc gia xanh mát và hệ sinh thái biển đa dạng. Du khách sẽ được tham quan hang Quân Y, tắm biển tại Cát Cò, du thuyền trên vịnh Lan Hạ và thưởng thức hải sản tươi ngon. Đây là điểm đến lý tưởng cho du lịch nghỉ dưỡng cuối tuần.', 'Hoạt động', '', 'Hà Nội', 'Ngày 1:\r\nNgày 2:', 1, 'Gia đình', '2 ngày 1 đêm', 1900000, 'Xe khách', 'Bắc'),
(80, 28, 'Tour Đài Loan', 'Hiện đại', 11000000, '30', 30, 10, 'Tour đưa bạn khám phá Đài Bắc sôi động với tháp Taipei 101, làng cổ Jiufen, công viên Dương Minh Sơn đến Cao Hùng – thành phố cảng hiện đại. Bạn sẽ được thưởng thức ẩm thực đường phố tại chợ đêm Shilin, trải nghiệm văn hóa đậm chất Hoa và chiêm ngưỡng cảnh sắc thiên nhiên hài hòa giữa núi rừng và biển cả.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo đoàn', '2 ngày 1 đêm', 10000000, 'Máy bay', 'Ngoài nước'),
(81, 31, 'Tour Đức', 'Hiện đại', 20000000, '30', 12, 1, 'Khám phá nước Đức hiện đại với thành phố Berlin lịch sử, lâu đài Neuschwanstein như cổ tích, sông Rhine thơ mộng và vùng Bavaria truyền thống. Bạn sẽ được tìm hiểu lịch sử thế giới qua Bức tường Berlin, lang thang ở quảng trường Marienplatz và nếm thử bia Đức trứ danh trong các lễ hội.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo nhóm nhỏ', '2 ngày 1 đêm', 0, 'Máy bay', 'Ngoài nước'),
(82, 30, 'Tour Gia Lai', 'Sinh thái', 2800000, '20', 30, 10, 'Gia Lai nổi bật với Biển Hồ Pleiku thơ mộng, thác Phú Cường hùng vĩ, núi lửa Chư Đăng Ya rực rỡ mùa dã quỳ. Du khách còn được hòa mình vào văn hóa Tây Nguyên qua tiếng cồng chiêng, nhà rông và lễ hội truyền thống. Thích hợp cho người thích khám phá thiên nhiên và tìm về bản sắc văn hóa dân tộc.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Gia đình', '2 ngày 1 đêm', 2700000, 'Xe khách', 'Trung'),
(83, 19, 'Tour Hạ Long', 'Sinh thái', 3000000, '20', 15, 10, 'Vịnh Hạ Long là biểu tượng du lịch Việt Nam với hàng ngàn đảo đá vôi kỳ vĩ. Tour đưa bạn du ngoạn trên du thuyền sang trọng, khám phá hang Sửng Sốt, đảo Titop, hang Đầu Gỗ và thưởng thức hải sản tươi ngon trên biển. Đây là tour lý tưởng cho cả nghỉ dưỡng, trăng mật và khám phá di sản UNESCO.', 'Hoạt động', '', 'Hà Nội', 'Ngày 1:\r\nNgày 2:', 1, 'Gia đình', '2 ngày 1 đêm', 2900000, 'Xe khách', 'Bắc'),
(84, 32, 'Tour Hội An', 'Sinh thái', 3500000, '20', 40, 10, 'Hội An cuốn hút du khách bởi vẻ đẹp cổ kính, những ngôi nhà tường vàng mái ngói rêu phong và ánh đèn lồng lung linh về đêm. Tour đưa bạn dạo bước trên phố cổ, tham quan chùa Cầu, nhà cổ Tấn Ký, chợ Hội An, và thưởng thức ẩm thực đặc trưng như cao lầu, bánh mì Phượng, cơm gà Bà Buội. Không gian bình yên nơi đây phù hợp cho cả nghỉ dưỡng lẫn khám phá văn hóa.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo đoàn', '2 ngày 1 đêm', 3100000, 'Xe khách', 'Trung'),
(86, 19, 'Tour Hồng Kông', 'Sinh thái', 24000000, '20', 30, 10, 'Hồng Kông nổi tiếng với nền kinh tế năng động, cảnh quan hiện đại xen lẫn truyền thống. Du khách sẽ được chiêm ngưỡng toàn cảnh từ đỉnh The Peak, tham quan Đại lộ Ngôi sao, thưởng ngoạn cảnh đêm Cảng Victoria và khám phá Disneyland Hồng Kông. Tour phù hợp cho gia đình có trẻ nhỏ và người đam mê mua sắm.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:\r\nNgày 3:', 1, 'Theo đoàn', '3 ngày 2 đêm', 0, 'Máy bay', 'Ngoài nước'),
(87, 26, 'Tour Italia', 'Hiện đại', 26000000, '30', 20, 10, 'Du lịch Italia là hành trình về với văn minh phương Tây, nơi có đấu trường Colosseum hùng vĩ, tháp nghiêng Pisa độc đáo và kênh đào Venice nên thơ. Tour đưa bạn khám phá các thành phố nghệ thuật như Rome, Florence, Milan, và nếm thử ẩm thực đặc trưng: pizza, pasta, gelato. Thích hợp cho cặp đôi, người yêu kiến trúc và lịch sử.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo đoàn', '2 ngày 1 đêm', 0, 'Máy bay', 'Ngoài nước'),
(88, 30, 'Tour Lâm Đồng', 'Sinh thái', 5000000, '30', 30, 10, 'Ngoài Đà Lạt, Lâm Đồng còn ẩn chứa nhiều điểm đến hấp dẫn như thác Pongour, núi Langbiang, đồi chè Tâm Châu và làng Cù Lần. Tour đưa bạn đến những vùng đất yên bình, gần gũi thiên nhiên, thích hợp cho du lịch sinh thái, nghỉ dưỡng và team building.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Gia đình', '2 ngày 1 đêm', 0, 'Xe khách', 'Tây'),
(89, 37, 'Tour Lý Sơn', 'Hiện đại', 6000000, '30', 25, 10, 'Lý Sơn là viên ngọc thô ngoài khơi Quảng Ngãi, nơi có bãi biển hoang sơ, vách đá nham thạch ấn tượng và những cánh đồng tỏi đặc trưng. Tour đưa bạn chinh phục cột cờ Tổ quốc, đỉnh Thới Lới, chùa Hang và đảo Bé, đồng thời trải nghiệm hải sản tươi ngon. Thích hợp cho người thích khám phá, check-in và thư giãn.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo nhóm nhỏ', '2 ngày 1 đêm', 5500000, 'Xe khách', 'Trung'),
(90, 19, 'Tour Ninh Thuận', 'Sinh thái', 3500000, '20', 25, 10, 'Ninh Thuận gây ấn tượng bởi khung cảnh hoang sơ của biển Ninh Chữ, vịnh Vĩnh Hy và đồi cát Nam Cương. Du khách còn có cơ hội tìm hiểu văn hóa Chăm tại tháp Po Klong Garai, làng gốm Bàu Trúc, và thưởng thức đặc sản nho, táo, thịt cừu. Tour phù hợp cho những ai yêu vẻ đẹp thiên nhiên nguyên bản và trải nghiệm văn hóa bản địa độc đáo.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Gia đình', '2 ngày 1 đêm', 3400000, 'Xe khách', 'Nam'),
(91, 35, 'Tour Phan Thiết', 'Sinh thái', 5000000, '30', 29, 10, 'Tour đưa bạn đến với Mũi Né – thiên đường nghỉ dưỡng với bãi biển trong xanh, đồi cát bay và làng chài rực rỡ. Khám phá Suối Tiên, lâu đài rượu vang, tháp Chăm Poshanư và thưởng thức hải sản tươi sống ven biển. Phù hợp cho du lịch nghỉ dưỡng ngắn ngày và kỳ nghỉ gia đình.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo đoàn', '2 ngày 1 đêm', 0, 'Xe khách', 'Nam'),
(92, 33, 'Tour Pháp', 'Hiện đại', 30000000, '30', 40, 12, 'Du lịch Pháp là hành trình chạm đến trái tim của châu Âu, nơi có tháp Eiffel biểu tượng, đại lộ Champs-Élysées, cung điện Versailles và bảo tàng Louvre. Bạn sẽ được trải nghiệm không khí lãng mạn của Paris, văn hóa nghệ thuật tinh tế, cùng ẩm thực trứ danh như bánh mì baguette, rượu vang và phô mai. Phù hợp cho cặp đôi và du lịch cao cấp.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:\r\nNgày 3:', 1, 'Theo đoàn', '3 ngày 2 đêm', 28000000, 'Máy bay', 'Ngoài nước'),
(93, 24, 'Tour Singapore', 'Hiện đại', 15000000, '40', 30, 10, 'Singapore chào đón bạn bằng vẻ hiện đại bậc nhất Đông Nam Á với Marina Bay Sands, Vườn bên Vịnh (Gardens by the Bay), đảo Sentosa và phố Orchard sầm uất. Tour kết hợp giữa vui chơi, mua sắm và trải nghiệm văn hóa đa dạng trong môi trường an toàn, thân thiện. Rất lý tưởng cho gia đình và nhóm bạn trẻ.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo nhóm nhỏ', '2 ngày 1 đêm', 14000000, 'Máy bay', 'Ngoài nước'),
(94, 36, 'Tour Tây Ban Nha', 'Hiện đại', 30000000, '30', 25, 11, 'Tây Ban Nha mang đến trải nghiệm đậm chất Latin với Barcelona nghệ thuật, Madrid sôi động và vùng Andalusia rực rỡ. Tour đưa bạn chiêm ngưỡng công trình của Gaudí, thưởng thức flamenco, và khám phá các đấu trường bò tót. Ẩm thực đặc trưng với tapas, paella và rượu sangria cũng là điểm nhấn không thể bỏ lỡ.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1:\r\nNgày 2:', 1, 'Theo đoàn', '2 ngày 1 đêm', 28000000, 'Máy bay', 'Ngoài nước'),
(95, 34, 'Tour Tây Ninh', 'Văn hóa', 4000000, '20', 15, 5, 'Tây Ninh là điểm đến tâm linh nổi bật với núi Bà Đen – ngọn núi cao nhất Nam Bộ và hệ thống cáp treo hiện đại. Du khách còn được tham quan Tòa Thánh Cao Đài – công trình kiến trúc độc đáo kết hợp nhiều tôn giáo, và thưởng thức đặc sản bánh tráng phơi sương, muối tôm Tây Ninh. Thích hợp cho du lịch hành hương cuối tuần.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: TP.HCM – Tòa Thánh Tây Ninh – Núi Bà Đen\r\n07h00: Xe đón quý khách tại điểm hẹn, khởi hành đi Tây Ninh.\r\n\r\n09h30: Đến Tòa Thánh Tây Ninh – chiêm ngưỡng kiến trúc độc đáo của đạo Cao Đài, tìm hiểu nghi lễ tôn giáo đặc trưng.\r\n\r\n11h00: Dùng cơm trưa tại nhà hàng địa phương.\r\n\r\n13h30: Tham quan Núi Bà Đen – “nóc nhà Nam Bộ”, đi cáp treo hiện đại Sun World (chi phí tùy tour).\r\n\r\nViếng chùa Bà Đen linh thiêng.\r\n\r\nChụp ảnh tại các điểm cao của núi (nếu trời đẹp).\r\n\r\n17h00: Nhận phòng khách sạn, nghỉ ngơi.\r\n\r\n18h30: Ăn tối, tự do khám phá Tây Ninh về đêm.\r\n\r\nNgày 2: Hồ Dầu Tiếng – Ma Thiên Lãnh – Thung lũng đá\r\n07h00: Ăn sáng tại khách sạn.\r\n\r\n08h00: Di chuyển đến khu vực Hồ Dầu Tiếng – một trong những hồ nước nhân tạo lớn nhất Việt Nam, phong cảnh hữu tình.\r\n\r\n10h00: Khám phá Ma Thiên Lãnh – nơi được mệnh danh là “Đà Lạt thu nhỏ” của Tây Ninh.\r\n\r\nTham quan thung lũng đá, suối Đá, chụp ảnh sống ảo.\r\n\r\n12h00: Ăn trưa tại nhà hàng sinh thái ven hồ.\r\n\r\n14h00: Về lại khách sạn nghỉ ngơi.\r\n\r\n16h30: Tự do khám phá chợ đêm Tây Ninh, mua đặc sản: bánh tráng phơi sương, muối tôm Tây Ninh...\r\n\r\n18h30: Ăn tối & tham gia hoạt động giao lưu (nếu đi theo đoàn).\r\n\r\nNgày 3: Tham quan địa đạo – Về lại TP.HCM\r\n07h00: Ăn sáng, trả phòng khách sạn.\r\n\r\n08h00: Tham quan Địa đạo An Thới (nếu mở cửa) – tìm hiểu lịch sử chiến tranh tại Tây Ninh.\r\n\r\n10h00: Ghé chùa Gò Kén – ngôi chùa có kiến trúc Á – Âu độc đáo.\r\n\r\n11h30: Ăn trưa, nghỉ ngơi.\r\n\r\n13h30: Khởi hành về lại TP.HCM.\r\n\r\n17h00: Về đến điểm hẹn ban đầu, kết thúc chương trình.\r\n\r\nGợi ý đặc sản Tây Ninh nên mua:\r\nBánh tráng me, bánh tráng cuốn muối tôm.\r\n\r\nMuối tôm Tây Ninh.\r\n\r\nMắm chua ngọt, nem bưởi.', 1, 'Gia đình', '3 ngày 2 đêm', 3800000, 'Xe khách', 'Tây'),
(96, 24, 'Tour Thổ Nhĩ Kỳ', 'Hiện đại', 28000000, '30', 30, 10, 'Thổ Nhĩ Kỳ mang đến một hành trình đặc biệt qua Istanbul cổ kính, Cappadocia kỳ ảo với khinh khí cầu và Pamukkale trắng xóa như thiên đường. Bạn sẽ được chiêm ngưỡng kiến trúc Hồi giáo lộng lẫy, trải nghiệm tắm Thổ Nhĩ Kỳ và thưởng thức ẩm thực đặc trưng như kebab, trà đen và bánh Baklava. Một lựa chọn hấp dẫn cho du lịch văn hóa – lịch sử – phiêu lưu. 🇨🇭 Tour Thụy Sĩ – Vùng đất của tuyết trắng và đồng hồ chính xác', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Istanbul – Cung điện Topkapi – Chợ Grand Bazaar\r\nSáng:\r\n\r\nĐến sân bay quốc tế Istanbul (IST), làm thủ tục nhập cảnh.\r\n\r\nXe đón đoàn, đưa đi ăn sáng nhẹ và bắt đầu hành trình tham quan.\r\n\r\nTrưa:\r\n\r\nTham quan Cung điện Topkapi – nơi ở của các vị vua Ottoman trong suốt 4 thế kỷ.\r\n\r\nDùng bữa trưa tại nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nTham quan Hippodrome, Thánh đường Xanh (Blue Mosque) và Hagia Sophia – di sản thế giới UNESCO.\r\n\r\nMua sắm tại Chợ Grand Bazaar – khu chợ có mái vòm lớn nhất thế giới, nổi tiếng với đồ da, thảm, đồ lưu niệm.\r\n\r\nTối:\r\n\r\nDùng bữa tối, nhận phòng khách sạn nghỉ ngơi tại Istanbul.\r\n\r\nNgày 2: Istanbul – Cappadocia – Thung lũng nấm – Khinh khí cầu\r\nSáng:\r\n\r\nDùng bữa sáng sớm, sau đó ra sân bay nội địa bay đến Cappadocia (khoảng 1.5 giờ).\r\n\r\nXe đón và đưa đi tham quan:\r\n\r\nThung lũng Devrent (thung lũng Tưởng Tượng) – với những mỏm đá hình con vật kỳ lạ.\r\n\r\nThung lũng Pasabag (còn gọi là Thung lũng Nấm) – nơi có các cột đá hình cây nấm độc đáo.\r\n\r\nTrưa:\r\n\r\nDùng bữa tại nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nTham quan Thành phố ngầm Kaymakli hoặc Derinkuyu – được đào sâu hàng chục mét dưới lòng đất.\r\n\r\nGhé Xưởng thảm thủ công truyền thống Thổ Nhĩ Kỳ.\r\n\r\nTối:\r\n\r\nĂn tối & nghỉ đêm tại khách sạn đá trong lòng núi (cave hotel) ở Cappadocia.\r\n\r\nNếu đăng ký, quý khách có thể tham gia show múa bụng Thổ Nhĩ Kỳ hoặc bay khinh khí cầu sáng hôm sau (chi phí riêng).\r\n\r\nNgày 3: Cappadocia – Ankara – Istanbul\r\nSáng:\r\n\r\n(Nếu đăng ký) Trải nghiệm khinh khí cầu ngắm bình minh Cappadocia.\r\n\r\nDùng bữa sáng tại khách sạn.\r\n\r\nDi chuyển đi Ankara – thủ đô Thổ Nhĩ Kỳ (~3.5 tiếng).\r\n\r\nTrưa:\r\n\r\nĂn trưa tại Ankara, sau đó tham quan:\r\n\r\nLăng Mustafa Kemal Atatürk – vị cha già dân tộc của Thổ Nhĩ Kỳ hiện đại.\r\n\r\nGhé mua sắm tại một trung tâm thương mại lớn.\r\n\r\nChiều – Tối:\r\n\r\nDi chuyển về lại Istanbul hoặc ra sân bay Ankara bay về Istanbul nếu cần.\r\n\r\nKết thúc chương trình tour, đưa đoàn ra sân bay về nước hoặc tiếp tục hành trình.\r\n\r\nGợi ý đặc sản & quà nên mua:\r\nĐèn lồng Thổ Nhĩ Kỳ, khăn quàng, đồ gốm sứ.\r\n\r\nTrà lựu, bánh Baklava, kẹo Turkish Delight.\r\n\r\nGia vị truyền thống, thảm len thủ công.', 1, 'Theo đoàn', '3 ngày 2 đêm', 0, 'Máy bay', 'Ngoài nước'),
(97, 19, 'Tour Thụy Sĩ', 'Sinh thái', 34000000, '30', 40, 10, 'Thụy Sĩ chinh phục du khách bằng vẻ đẹp hùng vĩ của núi Alps, những hồ nước trong xanh như tranh vẽ và sự tinh tế trong từng nhịp sống. Hành trình có thể đưa bạn qua Lucerne cổ kính, Interlaken yên bình đến Zermatt – nơi ngắm đỉnh Matterhorn nổi tiếng. Trải nghiệm tàu Glacier Express băng qua núi tuyết, thưởng thức socola nguyên chất và ngắm nhìn sự chuẩn mực trong từng thành phố như Zurich hay Geneva. Đây là điểm đến lý tưởng cho những ai yêu thiên nhiên, sự ngăn nắp và vẻ đẹp thanh lịch.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Zurich – Lucerne – Interlaken\r\nSáng:\r\n\r\nĐến Zurich, xe đón đoàn tại sân bay.\r\n\r\nKhởi hành đi Lucerne (~1 giờ).\r\n\r\nTham quan:\r\n\r\nCầu gỗ Chapel Bridge nổi tiếng – biểu tượng của Lucerne.\r\n\r\nHồ Lucerne thơ mộng.\r\n\r\nTượng Sư Tử đá (Lion Monument) – biểu tượng lòng dũng cảm của lính đánh thuê Thụy Sĩ.\r\n\r\nTrưa:\r\n\r\nDùng bữa tại nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nDi chuyển đến Interlaken – thiên đường nghỉ dưỡng giữa hai hồ.\r\n\r\nTản bộ tại khu phố cổ, ghé thăm sòng bạc Casino Kursaal (nếu thích).\r\n\r\nTối:\r\n\r\nNhận phòng khách sạn tại Interlaken.\r\n\r\nDùng bữa tối & nghỉ ngơi.\r\n\r\nNgày 2: Interlaken – Đỉnh Jungfrau – Lauterbrunnen\r\nSáng:\r\n\r\nĂn sáng sớm tại khách sạn.\r\n\r\nDi chuyển đến ga Grindelwald hoặc Lauterbrunnen, lên tàu răng cưa chinh phục:\r\n\r\nĐỉnh Jungfrau – Top of Europe (3.454m)\r\n\r\nTham quan: cung điện băng, đài quan sát Sphinx, ngắm toàn cảnh dãy Alps và sông băng Aletsch.\r\n\r\nTrưa:\r\n\r\nDùng bữa tại nhà hàng trên đỉnh hoặc tại ga Kleine Scheidegg (trên đường xuống).\r\n\r\nChiều:\r\n\r\nTrở về Interlaken, nếu còn thời gian có thể dạo quanh Hồ Thun hoặc Hồ Brienz.\r\n\r\nTối:\r\n\r\nĂn tối tại nhà hàng Thụy Sĩ truyền thống (nên thử fondue phô mai).\r\n\r\nNghỉ đêm tại khách sạn.\r\n\r\nNgày 3: Interlaken – Geneva – Rời Thụy Sĩ\r\nSáng:\r\n\r\nTrả phòng, di chuyển đi Geneva (~3 giờ).\r\n\r\nTham quan các địa danh nổi bật:\r\n\r\nTrụ sở Liên Hợp Quốc Geneva, đài phun nước Jet d’Eau, đồng hồ hoa.\r\n\r\nPhố cổ Geneva, Nhà thờ St. Pierre.\r\n\r\nTrưa:\r\n\r\nĂn trưa tại trung tâm thành phố.\r\n\r\nChiều:\r\n\r\nMua sắm đồng hồ, chocolate Thụy Sĩ, dao đa năng tại cửa hàng miễn thuế.\r\n\r\nXe đưa ra sân bay Geneva / quay về Zurich tùy tuyến bay.\r\n\r\nKết thúc hành trình.\r\n\r\nĐặc sản Thụy Sĩ nên mua:\r\nChocolate cao cấp (Lindt, Läderach, Toblerone).\r\n\r\nĐồng hồ Thụy Sĩ (Tissot, Longines, Rolex – nếu ngân sách cho phép).\r\n\r\nDao đa năng Victorinox, phô mai Emmental, rượu vang trắng vùng Valais.', 1, 'Theo đoàn', '3 ngày 2 đêm', 30000000, 'Máy bay', 'Ngoài nước'),
(98, 26, 'Tour Hà Lan', 'Hiện đại', 40000000, '40', 30, 10, 'Hà Lan mang đến trải nghiệm sống động giữa hiện đại và truyền thống. Du khách có thể dạo thuyền trên những con kênh cổ ở Amsterdam, ghé thăm làng cổ Zaanse Schans với những chiếc cối xay gió hoạt động suốt hàng trăm năm. Vào mùa xuân, vườn Keukenhof rực rỡ với hàng triệu đóa tulip khoe sắc. Hà Lan cũng nổi tiếng với xe đạp, pho mát, tranh Van Gogh và một phong cách sống thân thiện với môi trường. Phù hợp cho các tín đồ nghệ thuật, yêu thiên nhiên và văn hóa đặc trưng.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Amsterdam – City Tour – Du thuyền trên kênh đào\r\nSáng:\r\n\r\nĐến Amsterdam, xe đón tại sân bay Schiphol.\r\n\r\nTham quan:\r\n\r\nQuảng trường Dam, Hoàng cung Koninklijk Paleis.\r\n\r\nKhu phố cổ Amsterdam, các tòa nhà nghiêng đặc trưng bên kênh.\r\n\r\nTrưa:\r\n\r\nDùng bữa tại nhà hàng Hà Lan địa phương.\r\n\r\nChiều:\r\n\r\nTham quan:\r\n\r\nBảo tàng Van Gogh hoặc Rijksmuseum – nơi lưu giữ nghệ thuật Hà Lan.\r\n\r\nXưởng chế tác kim cương Gassan (Hà Lan nổi tiếng về cắt kim cương).\r\n\r\nTrải nghiệm du thuyền kênh đào – ngắm thành phố từ góc nhìn thơ mộng.\r\n\r\nTối:\r\n\r\nDùng bữa tối & tự do dạo chơi, có thể tham quan khu Red Light District (phố đèn đỏ) – một nét văn hóa mở đặc trưng.\r\n\r\nNghỉ đêm tại khách sạn ở Amsterdam.\r\n\r\nNgày 2: Zaanse Schans – Volendam – Làng cổ Hà Lan\r\nSáng:\r\n\r\nĂn sáng tại khách sạn.\r\n\r\nKhởi hành đến Zaanse Schans – làng cối xay gió nổi tiếng Hà Lan:\r\n\r\nTham quan các cối xay gió hoạt động thật.\r\n\r\nGhé xưởng làm guốc gỗ truyền thống, xưởng sản xuất phô mai.\r\n\r\nTrưa:\r\n\r\nĂn trưa tại làng chài Volendam – thị trấn ven biển yên bình.\r\n\r\nChiều:\r\n\r\nTham quan:\r\n\r\nTản bộ chụp ảnh với trang phục dân tộc Hà Lan truyền thống.\r\n\r\nMua quà lưu niệm handmade, phô mai, cá trích muối.\r\n\r\nTrở về Amsterdam.\r\n\r\nTối:\r\n\r\nĂn tối và nghỉ đêm tại khách sạn.\r\n\r\nNgày 3: Công viên hoa Keukenhof (mùa xuân) – Mua sắm – Rời Hà Lan\r\nSáng:\r\n\r\n(Từ tháng 3–5) Tham quan công viên hoa Keukenhof tại Lisse – vườn hoa lớn nhất thế giới, nổi bật với hoa tulip Hà Lan.\r\n\r\nNgoài mùa tulip, có thể thay bằng:\r\n\r\nVườn Bloemenmarkt (chợ hoa nổi).\r\n\r\nVườn thực vật Hortus Botanicus hoặc Vườn Vondelpark.\r\n\r\nTrưa:\r\n\r\nDùng bữa trưa, sau đó di chuyển về trung tâm.\r\n\r\nChiều:\r\n\r\nMua sắm tại khu phố Kalverstraat hoặc trung tâm thương mại De Bijenkorf.\r\n\r\nXe đưa đoàn ra sân bay Schiphol, kết thúc tour.\r\n\r\nĐặc sản Hà Lan nên mua:\r\nPhô mai Gouda, bánh Stroopwafel.\r\n\r\nGuốc gỗ truyền thống, đồ lưu niệm hình cối xay gió.\r\n\r\nHoa tulip khô / hạt giống, socola, rượu gin Hà Lan (Jenever).', 1, 'Gia đình', '3 ngày 2 đêm', 35000000, 'Máy bay', 'Ngoài nước'),
(99, 27, 'Tour Bỉ', 'Hiện đại', 25000000, '20', 30, 10, 'Bỉ là quốc gia nhỏ bé nhưng sở hữu kho tàng văn hóa, ẩm thực và kiến trúc phong phú. Brussels – thủ đô châu Âu – quyến rũ với Quảng trường Grand Place và biểu tượng Manneken Pis. Bruges và Ghent lại đưa bạn ngược dòng thời gian với những con kênh, ngôi nhà cổ và lâu đài Trung cổ. Bỉ còn nổi tiếng toàn thế giới với socola cao cấp, bia thủ công và món khoai tây chiên trứ danh. Đây là điểm đến tuyệt vời cho du khách yêu thích lịch sử, ẩm thực và nhịp sống thư thái.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Brussels – City Tour thủ đô\r\nSáng:\r\n\r\nĐến Brussels, xe đón tại sân bay.\r\n\r\nTham quan:\r\n\r\nQuảng trường Grand Place – trung tâm lịch sử tuyệt đẹp, được UNESCO công nhận.\r\n\r\nTượng Manneken Pis – cậu bé đứng tè biểu tượng thú vị của Brussels.\r\n\r\nTòa thị chính Brussels, nhà nguyện Saint-Hubert.\r\n\r\nTrưa:\r\n\r\nDùng bữa trưa tại nhà hàng địa phương, thưởng thức khoai tây chiên & bia Bỉ.\r\n\r\nChiều:\r\n\r\nTham quan:\r\n\r\nBảo tàng sôcôla hoặc ghé tiệm Pierre Marcolini / Neuhaus / Leonidas.\r\n\r\nAtomium – công trình kiến trúc độc đáo hình nguyên tử, biểu tượng của Bỉ hiện đại.\r\n\r\nTối:\r\n\r\nĂn tối với món truyền thống Moules-frites (trai hấp bia + khoai tây chiên).\r\n\r\nNghỉ đêm tại Brussels.\r\n\r\nNgày 2: Brussels – Bruges – Ghent – Thành phố cổ kính\r\nSáng:\r\n\r\nĂn sáng tại khách sạn, khởi hành đi Bruges (~1.5 giờ).\r\n\r\nTham quan:\r\n\r\nKênh đào Bruges – “Venice phương Bắc”, đi thuyền ngắm phố cổ.\r\n\r\nTháp chuông Belfry, quảng trường Burg, nhà thờ Đức Bà.\r\n\r\nTản bộ trong phố cổ, thưởng thức socola thủ công.\r\n\r\nTrưa:\r\n\r\nDùng bữa tại Bruges với món hầm bò Bỉ (Carbonade flamande).\r\n\r\nChiều:\r\n\r\nDi chuyển đến Ghent (~45 phút).\r\n\r\nTham quan:\r\n\r\nLâu đài Gravensteen thời Trung Cổ.\r\n\r\nNhà thờ St. Bavo, quảng trường Sint-Baafsplein.\r\n\r\nChụp ảnh tại cầu Saint Michael nổi tiếng.\r\n\r\nTrở về Brussels.\r\n\r\nTối:\r\n\r\nTự do khám phá Brussels về đêm, nghỉ ngơi tại khách sạn.\r\n\r\nNgày 3: Brussels – Mua sắm – Rời Bỉ\r\nSáng:\r\n\r\nĂn sáng, tự do mua sắm tại:\r\n\r\nGaleries Royales Saint-Hubert – trung tâm mua sắm lâu đời, kiến trúc vòm kính cổ điển.\r\n\r\nCửa hàng đồng hồ, bia, sôcôla đặc sản.\r\n\r\nTrưa:\r\n\r\nDùng bữa trưa tại trung tâm Brussels.\r\n\r\nChiều:\r\n\r\nXe đưa ra sân bay hoặc tiếp tục tour đến Pháp / Hà Lan / Đức nếu là tour liên tuyến.\r\n\r\n🎁 Đặc sản Bỉ nên mua:\r\nSôcôla cao cấp (Neuhaus, Godiva, Leonidas, Marcolini).\r\n\r\nBia Bỉ thủ công (Chimay, Leffe, Duvel).\r\n\r\nRen thủ công Bruges, bánh quy speculoos, tượng Manneken Pis mini.', 1, 'Theo nhóm nhỏ', '3 ngày 2 đêm', 0, 'Máy bay', 'Ngoài nước');
INSERT INTO `tour` (`id`, `idks`, `Name`, `Style`, `Price`, `Child_price_percen`, `Max_participant`, `Min_participant`, `Description`, `Status`, `Depart`, `DepartureLocation`, `Itinerary`, `employeesId`, `type`, `timetour`, `discount`, `vehicle`, `vung`) VALUES
(100, 12, 'Tour Áo', 'Sinh thái', 30000000, '20', 20, 10, 'Áo là đất nước của những bản giao hưởng, những ngọn núi tuyết và những thành phố duyên dáng. Vienna – thủ đô âm nhạc của thế giới – là nơi sản sinh ra những thiên tài như Mozart, Beethoven và có những cung điện lộng lẫy như Schönbrunn. Salzburg – quê hương của Giai điệu tình yêu – và Hallstatt – ngôi làng bên hồ đẹp như tranh – là điểm đến không thể bỏ qua. Tour Áo phù hợp cho những ai yêu vẻ đẹp tinh tế, lãng mạn và hòa mình vào văn hóa châu Âu cổ điển.', 'Hoạt động', '', 'Hà Nội', 'Ngày 1: Đến Vienna – Khám phá thủ đô âm nhạc\r\nSáng:\r\n\r\nĐến sân bay quốc tế Vienna, xe đón đoàn về trung tâm.\r\n\r\nTham quan:\r\n\r\nNhà thờ St. Stephen (Stephansdom) – biểu tượng kiến trúc Gothic của Vienna.\r\n\r\nQuảng trường Stephansplatz, phố mua sắm Kärntner Straße.\r\n\r\nTrưa:\r\n\r\nThưởng thức bữa trưa đặc sản Áo: Wiener Schnitzel (thịt bê chiên xù).\r\n\r\nChiều:\r\n\r\nTham quan:\r\n\r\nCung điện Hoàng gia Hofburg – nơi ở của Hoàng tộc Habsburg.\r\n\r\nTòa nhà Quốc hội, Nhà hát Opera Vienna.\r\n\r\nDạo quanh khu phố cổ được UNESCO công nhận.\r\n\r\nTối:\r\n\r\nĂn tối & nghỉ đêm tại khách sạn ở Vienna.\r\n\r\nNgày 2: Vienna – Hallstatt – Thị trấn cổ tích\r\nSáng:\r\n\r\nĂn sáng tại khách sạn.\r\n\r\nKhởi hành đến Hallstatt (~3 tiếng) – thị trấn bên hồ nổi tiếng như tranh vẽ.\r\n\r\nTrên đường, dừng chân chụp ảnh phong cảnh núi Alps tuyệt đẹp.\r\n\r\nTrưa:\r\n\r\nĐến Hallstatt, ăn trưa tại nhà hàng địa phương bên hồ.\r\n\r\nChiều:\r\n\r\nTham quan:\r\n\r\nHồ Hallstatt, nhà thờ cổ Hallstatt, xương sọ trang trí tại Beinhaus.\r\n\r\nTản bộ khám phá ngõ nhỏ, cửa hàng thủ công mỹ nghệ.\r\n\r\nTùy chọn: đi cáp treo lên Skywalk Hallstatt ngắm toàn cảnh hồ và dãy Alps.\r\n\r\nTối:\r\n\r\nTrở lại Vienna, ăn tối và nghỉ đêm.\r\n\r\nNgày 3: Cung điện Schönbrunn – Mua sắm – Rời Áo\r\nSáng:\r\n\r\nĂn sáng, sau đó tham quan:\r\n\r\nCung điện Schönbrunn – nơi ở mùa hè của Hoàng tộc, đẹp như cung Versailles.\r\n\r\nTản bộ trong vườn kiểu Pháp, chụp ảnh tại đài phun nước Neptune.\r\n\r\nTrưa:\r\n\r\nĂn trưa, sau đó tự do mua sắm tại:\r\n\r\nMariahilfer Straße – phố mua sắm nổi tiếng ở Vienna.\r\n\r\nCửa hàng lưu niệm, socola Mozart, pha lê Swarovski.\r\n\r\nChiều:\r\n\r\nXe đưa ra sân bay, kết thúc tour nước Áo.\r\n\r\n🎁 Đặc sản Áo nên mua:\r\nMozartkugel (kẹo socola nhân hạnh nhân truyền thống).\r\n\r\nRượu vang trắng, đồ da, pha lê Swarovski, đồ cổ.\r\n\r\nBánh Sacher Torte, bánh Apfelstrudel (bánh táo).', 1, 'Theo nhóm nhỏ', '3 ngày 2 đêm', 28000000, 'Máy bay', 'Ngoài nước'),
(101, 36, 'Tour Hungary', 'Hiện đại', 28000000, '30', 40, 10, 'Hungary hấp dẫn du khách bằng vẻ đẹp vừa cổ điển vừa năng động, nổi bật với Budapest – một trong những thủ đô đẹp nhất châu Âu. Bạn sẽ được chiêm ngưỡng tòa nhà Quốc hội tráng lệ, tắm khoáng nóng truyền thống tại Széchenyi, dạo bộ trên cầu Chain Bridge và ngắm thành phố lung linh khi về đêm. Hungary còn nổi tiếng với món súp gulyás, bánh ngọt truyền thống và văn hóa cà phê đậm chất Đông Âu. Một hành trình phù hợp cho người muốn trải nghiệm sâu sắc văn hóa và lịch sử Trung Âu.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Đến Budapest – Dạo phố cổ Buda\r\nSáng:\r\n\r\nXe đón tại sân bay Budapest Ferenc Liszt.\r\n\r\nTham quan khu Buda cổ kính:\r\n\r\nPháo đài Ngư phủ (Fisherman’s Bastion) – điểm ngắm toàn cảnh sông Danube tuyệt đẹp.\r\n\r\nNhà thờ Matthias – kiến trúc Gothic độc đáo.\r\n\r\nLâu đài Buda Castle – cung điện Hoàng gia xưa.\r\n\r\nTrưa:\r\n\r\nThưởng thức đặc sản goulash (súp bò Hungary).\r\n\r\nChiều:\r\n\r\nDạo bộ tại Cầu Xích Széchenyi – nối liền Buda và Pest.\r\n\r\nGhé đồi Gellért ngắm toàn cảnh thành phố.\r\n\r\nTối:\r\n\r\nDu thuyền sông Danube ngắm thành phố lên đèn lung linh.\r\n\r\nĂn tối và nghỉ đêm tại khách sạn ở Budapest.\r\n\r\nNgày 2: Pest – Tòa nhà Quốc hội – Tắm khoáng nóng\r\nSáng:\r\n\r\nTham quan Pest hiện đại:\r\n\r\nTòa nhà Quốc hội Hungary – một trong những tòa nhà quốc hội đẹp nhất thế giới.\r\n\r\nQuảng trường Anh hùng (Heroes\' Square), Công viên Thành phố (Városliget).\r\n\r\nNhà hát Opera Budapest, Đại lộ Andrássy.\r\n\r\nTrưa:\r\n\r\nĂn trưa tại nhà hàng cổ Budapest.\r\n\r\nChiều:\r\n\r\nTrải nghiệm tắm khoáng nóng truyền thống tại Gellért Spa hoặc Széchenyi Spa – một trong những spa nước nóng lâu đời nhất châu Âu.\r\n\r\nTối:\r\n\r\nĂn tối tại nhà hàng truyền thống Hungary, thưởng thức nhạc dân gian sống động.\r\n\r\nNghỉ đêm tại Budapest.\r\n\r\nNgày 3: Mua sắm – Tạm biệt Budapest\r\nSáng:\r\n\r\nĂn sáng, sau đó tự do mua sắm tại:\r\n\r\nPhố Váci utca – phố đi bộ sầm uất với cửa hàng lưu niệm, thời trang, ẩm thực.\r\n\r\nChợ Trung tâm (Great Market Hall) – đặc sản, đồ thủ công, rượu Tokaji.\r\n\r\nTrưa:\r\n\r\nDùng bữa tại nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nXe đưa đoàn ra sân bay, kết thúc hành trình.\r\n\r\n🎁 Đặc sản Hungary nên mua:\r\nPaprika (ớt bột đặc trưng) – linh hồn ẩm thực Hungary.\r\n\r\nRượu vang Tokaji, mật ong, pha lê Herend.\r\n\r\nĐồ da thủ công, bánh kẹp lá quế (Kürtőskalács).', 1, 'Theo đoàn', '3 ngày 2 đêm', 25000000, 'Máy bay', 'Ngoài nước'),
(102, 24, 'Tour Hy Lạp', 'Hiện đại', 35000000, '30', 30, 10, 'Hy Lạp là điểm đến mê hoặc với di tích cổ đại, biển xanh ngọc và bầu trời ngập nắng. Athens – thủ đô lịch sử – mang dấu ấn huy hoàng với đền Parthenon, quảng trường cổ Agora và bảo tàng Acropolis. Nhưng Hy Lạp không chỉ có quá khứ – bạn còn có thể thư giãn tại đảo Santorini trắng xanh nổi tiếng, khám phá Mykonos sôi động hay Crete giàu truyền thống. Tour Hy Lạp là sự kết hợp hoàn hảo giữa văn hóa, nghỉ dưỡng và ẩm thực Địa Trung Hải thơm ngon.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Athens – Khám phá thủ đô cổ đại\r\nSáng:\r\n\r\nXe đón tại sân bay Athens International.\r\n\r\nTham quan Acropolis:\r\n\r\nĐền Parthenon – công trình nổi tiếng nhất của Hy Lạp cổ đại.\r\n\r\nThư viện Hadrian và Đền Athena Nike.\r\n\r\nBảo tàng Acropolis – nơi lưu giữ các hiện vật quý giá của nền văn minh cổ đại.\r\n\r\nDạo bước qua Plaka, khu phố cổ kính dưới chân Acropolis.\r\n\r\nTrưa:\r\n\r\nĂn trưa tại nhà hàng truyền thống, thưởng thức Souvlaki (thịt nướng xiên) và Greek Salad.\r\n\r\nChiều:\r\n\r\nTham quan Cổng Hadrian và Đền Olympian Zeus.\r\n\r\nTản bộ tại Syntagma Square, xem nghi thức đổi g guards trước tòa nhà Quốc hội.\r\n\r\nTối:\r\n\r\nDùng bữa tối tại nhà hàng nổi tiếng, thưởng thức các món hải sản tươi ngon.\r\n\r\nNghỉ đêm tại khách sạn ở Athens.\r\n\r\nNgày 2: Athens – Santorini – Đảo thiên đường\r\nSáng:\r\n\r\nĂn sáng tại khách sạn.\r\n\r\nKhởi hành đến Santorini bằng máy bay hoặc tàu cao tốc (~1 giờ bay).\r\n\r\nĐến Santorini, tham quan:\r\n\r\nOia – ngôi làng nổi tiếng với những ngôi nhà trắng và mái vòm xanh, là nơi lý tưởng để chụp ảnh.\r\n\r\nThị trấn Fira – thủ đô của Santorini, với những con phố nhỏ và các cửa hàng lưu niệm.\r\n\r\nBãi biển cát đen Kamari hoặc Bãi biển Perissa – nơi có những bãi biển độc đáo với cát đen từ núi lửa.\r\n\r\nTrưa:\r\n\r\nĂn trưa tại nhà hàng với view tuyệt đẹp ra biển.\r\n\r\nChiều:\r\n\r\nTham quan Làng Pyrgos – một trong những ngôi làng cổ nhất trên đảo, khám phá những con phố hẹp và yên bình.\r\n\r\nDừng chân tại Red Beach – bãi biển cát đỏ nổi tiếng, tận hưởng cảnh biển đẹp.\r\n\r\nTối:\r\n\r\nNgắm hoàng hôn tại Oia – đây là điểm ngắm hoàng hôn đẹp nhất Santorini.\r\n\r\nĂn tối tại nhà hàng ven biển và nghỉ đêm tại Santorini.\r\n\r\nNgày 3: Santorini – Athens – Mua sắm – Rời Hy Lạp\r\nSáng:\r\n\r\nĂn sáng tại khách sạn, tự do tham quan Santorini.\r\n\r\nTham quan Hầm rượu Santorini – nơi sản xuất rượu vang nổi tiếng, thử các loại rượu vang đặc sản.\r\n\r\nTrưa:\r\n\r\nĂn trưa tại một trong những nhà hàng nổi tiếng trên đảo.\r\n\r\nChiều:\r\n\r\nTự do mua sắm tại Fira, nơi có nhiều cửa hàng thủ công mỹ nghệ và đồ lưu niệm.\r\n\r\nXe đưa ra sân bay Santorini, bay về Athens.\r\n\r\nTối:\r\n\r\nTiếp tục chuyến bay hoặc tàu từ Athens trở về.\r\n\r\n🎁 Đặc sản Hy Lạp nên mua:\r\nRượu vang Santorini (Assyrtiko).\r\n\r\nOuzo – loại rượu đặc trưng của Hy Lạp.\r\n\r\nDầu olive, mật ong.\r\n\r\nCác sản phẩm thủ công như quần áo dệt tay, đồ gốm và đồ trang sức.', 1, 'Theo đoàn', '3 ngày 2 đêm', 30000000, 'Máy bay', 'Ngoài nước'),
(103, 19, 'Tour Châu Á – Việt Nam, Thái Lan, Singapore', 'Hiện đại', 50000000, '30', 50, 10, 'Cùng trải nghiệm tour du lịch vòng quanh các quốc gia Châu Á đang phát triển, nơi cảnh sắc và sự hiện đại đều có thể đáp ứng nhu cầu của bạn. Điểm xuất phát bắt đầu từ Việt Nam, nơi có cảnh sắc thiên nhiên hùng vỹ. Đến Thái Lan, vùng đất thiêng liêng nhưng cũng không kém phần sống động. Điểm kết thúc của hành trình là Singapore, đất nước nhỏ bé nhưng vô cùng hiện đại, các địa điểm du lịch nổi tiếng trong thành phố với cuộc sống nhộn nhịp sẽ giúp bạn thấy hứng thú hơn với chuyến đi.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Đến Hà Nội (Việt Nam) – Khám phá thủ đô\r\nSáng:\r\n\r\nĐến sân bay Nội Bài, xe đón và đưa đoàn về trung tâm thành phố Hà Nội.\r\n\r\nTham quan Hồ Hoàn Kiếm, dạo quanh khu vực Phố Cổ.\r\n\r\nTham quan Đền Ngọc Sơn trên hồ Hoàn Kiếm, Tháp Rùa.\r\n\r\nTrưa:\r\n\r\nThưởng thức phở Hà Nội, một trong những món ăn đặc trưng của Việt Nam.\r\n\r\nChiều:\r\n\r\nTham quan Lăng Chủ tịch Hồ Chí Minh, Chùa Một Cột, Văn Miếu Quốc Tử Giám.\r\n\r\nTự do tham quan mua sắm tại Chợ Đồng Xuân hoặc Hàng Ngang – Hàng Đào.\r\n\r\nTối:\r\n\r\nĂn tối tại nhà hàng địa phương và nghỉ đêm tại khách sạn ở Hà Nội.\r\n\r\nNgày 2: Hà Nội – Bay đến Bangkok (Thái Lan)\r\nSáng:\r\n\r\nĂn sáng tại khách sạn.\r\n\r\nXe đưa ra sân bay Nội Bài để bay đến Bangkok (khoảng 2 giờ bay).\r\n\r\nTrưa:\r\n\r\nĐến Bangkok, xe đón đoàn và ăn trưa tại nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nTham quan Chùa Wat Arun (Chùa Bình Minh) – ngôi chùa nổi tiếng với kiến trúc độc đáo.\r\n\r\nTham quan Cung điện Hoàng gia Thái Lan, Chùa Wat Phra Kaew (Chùa Phật Ngọc).\r\n\r\nDạo thuyền trên sông Chao Phraya, thưởng ngoạn phong cảnh Bangkok.\r\n\r\nTối:\r\n\r\nThưởng thức bữa tối với lẩu Thái hoặc pad Thai tại nhà hàng nổi tiếng.\r\n\r\nNghỉ đêm tại khách sạn ở Bangkok.\r\n\r\nNgày 3: Bangkok – Khám phá Thái Lan\r\nSáng:\r\n\r\nTham quan Chùa Wat Pho (Chùa Phật Ngủ) – ngôi chùa có tượng Phật dài 46m.\r\n\r\nGhé thăm Chợ Nổi Damnoen Saduak hoặc Chợ Chatuchak (tùy lịch trình).\r\n\r\nTrưa:\r\n\r\nĂn trưa tại nhà hàng, thưởng thức các món ăn Thái Lan đặc trưng.\r\n\r\nChiều:\r\n\r\nTham quan Trung tâm thương mại Siam Paragon, MBK Center.\r\n\r\nTự do mua sắm tại các trung tâm mua sắm nổi tiếng của Bangkok.\r\n\r\nTối:\r\n\r\nThưởng thức bữa tối tại nhà hàng và nghỉ đêm tại khách sạn ở Bangkok.\r\n\r\nNgày 4: Bay đến Singapore – Khám phá thành phố hiện đại\r\nSáng:\r\n\r\nĂn sáng tại khách sạn, sau đó bay từ Bangkok đến Singapore (khoảng 2 giờ bay).\r\n\r\nTrưa:\r\n\r\nĐến Singapore, tham quan Marina Bay Sands – tổ hợp nghỉ dưỡng, mua sắm, và casino nổi tiếng.\r\n\r\nTham quan Gardens by the Bay với Supertree Grove, Flower Dome và Cloud Forest.\r\n\r\nChiều:\r\n\r\nTham quan Merlion Park, chụp ảnh cùng Tượng Merlion – biểu tượng của Singapore.\r\n\r\nDạo quanh Chinatown và tham quan Chùa Răng Phật.\r\n\r\nTối:\r\n\r\nThưởng thức bữa tối tại Hawker Centre, nơi có các món ăn đường phố nổi tiếng.\r\n\r\nDạo chơi tại Clark Quay, tận hưởng không khí sôi động của Singapore về đêm.\r\n\r\nNgày 5: Singapore – Khám phá những điểm đến nổi bật\r\nSáng:\r\n\r\nTham quan Sentosa Island: Universal Studios Singapore, S.E.A. Aquarium hoặc Adventure Cove Waterpark (tùy sở thích).\r\n\r\nTham quan Bảo tàng ArtScience tại Marina Bay Sands.\r\n\r\nTrưa:\r\n\r\nDùng bữa trưa tại Raffles Hotel hoặc một trong những nhà hàng đặc sắc ở Singapore.\r\n\r\nChiều:\r\n\r\nTham quan Khu vườn tuyệt vời (Gardens by the Bay) và trải nghiệm SkyPark tại Marina Bay Sands.\r\n\r\nTối:\r\n\r\nDùng bữa tối và tự do tham quan hoặc mua sắm tại các trung tâm thương mại như Orchard Road.\r\n\r\nNghỉ đêm tại khách sạn ở Singapore.\r\n\r\nNgày 6: Mua sắm – Rời Singapore\r\nSáng:\r\n\r\nTự do mua sắm hoặc tham quan Singapore Zoo, Night Safari (tùy thời gian).\r\n\r\nTrưa:\r\n\r\nĂn trưa tại nhà hàng, sau đó xe đưa đoàn ra sân bay.\r\n\r\nKết thúc tour, chào tạm biệt Singapore và quay về.\r\n\r\n🎁 Đặc sản nên mua trong Tour:\r\nViệt Nam: Gạo tám Thái Bình, Mật ong, Cà phê Việt.\r\n\r\nThái Lan: Tượng Phật nhỏ, Lụa Thái, Thực phẩm Thái (Gia vị, nước mắm, gia vị chấm).\r\n\r\nSingapore: Chocolate Royce, Rượu Singapore Sling, Kẹo đặc sản.', 1, 'Theo đoàn', '6 ngày 5 đêm', 0, 'Máy bay', 'Ngoài nước'),
(104, 26, 'Tour Châu Âu – Anh, Pháp, Đức, Ý', 'Hiện đại', 60000000, '30', 30, 10, 'Tour du lịch mang đến cho du khách cái nhìn tổng quan về xứ sở Châu Âu xinh đẹp, nơi có các danh lam thắng cảnh như Tháp đồng hồ, Tháp Effel, Tháp nghiêng Pisa, … hay những nền ẩm thực nổi tiếng như Pháp, Ý sẽ làm cho thực khách có những trải nghiệm tuyệt vời và khó quên.', 'Hoạt động', '', 'TP.Hồ Chí Minh', 'Ngày 1: Đến London (Anh) – Khám phá thủ đô nước Anh\r\nSáng:\r\n\r\nĐến sân bay Heathrow hoặc Gatwick, xe đón đoàn đưa về khách sạn.\r\n\r\nTham quan Cung điện Buckingham – nơi ở của Nữ hoàng.\r\n\r\nCông viên St. James – khu vườn yên tĩnh ngay gần Cung điện Buckingham.\r\n\r\nChợ Borough – nơi bán các món ăn đặc trưng của Anh.\r\n\r\nTrưa:\r\n\r\nDùng bữa tại nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nTham quan Big Ben, Tháp đồng hồ Elizabeth, Cầu Tháp London.\r\n\r\nTham quan Bảo tàng Anh (British Museum) – với những hiện vật lịch sử quý giá từ các nền văn minh cổ đại.\r\n\r\nTối:\r\n\r\nThưởng thức bữa tối tại West End và xem một vở kịch nổi tiếng tại Theatre Royal.\r\n\r\nNghỉ đêm tại khách sạn ở London.\r\n\r\nNgày 2: London – Paris (Pháp)\r\nSáng:\r\n\r\nĂn sáng tại khách sạn, sau đó di chuyển đến Ga Eurostar để đi tàu cao tốc Eurostar từ London đến Paris (khoảng 2 giờ 15 phút).\r\n\r\nTrưa:\r\n\r\nĐến Paris, ăn trưa tại nhà hàng Pháp truyền thống.\r\n\r\nChiều:\r\n\r\nTham quan Tháp Eiffel – biểu tượng của Paris. Đưa bạn lên đỉnh tháp để ngắm toàn cảnh thành phố.\r\n\r\nTham quan Nhà thờ Đức Bà Paris.\r\n\r\nDạo bộ trên Champs-Élysées và chụp ảnh tại Cổng Khải Hoàn (Arc de Triomphe).\r\n\r\nTối:\r\n\r\nDùng bữa tối tại nhà hàng trên Tháp Eiffel hoặc một nhà hàng Pháp nổi tiếng.\r\n\r\nNghỉ đêm tại khách sạn ở Paris.\r\n\r\nNgày 3: Paris – Khám phá thêm Paris\r\nSáng:\r\n\r\nTham quan Bảo tàng Louvre – chiêm ngưỡng tác phẩm nổi tiếng như Mona Lisa, Vénus de Milo.\r\n\r\nDạo chơi tại Jardin des Tuileries và Place de la Concorde.\r\n\r\nTrưa:\r\n\r\nDùng bữa trưa tại một quán cà phê Parisian.\r\n\r\nChiều:\r\n\r\nTham quan Montmartre, nơi có Nhà thờ Sacré-Cœur và quang cảnh tuyệt đẹp của thành phố.\r\n\r\nDạo quanh khu phố Le Marais và thưởng thức các món ăn ngọt ngào tại Boulangeries.\r\n\r\nTối:\r\n\r\nThưởng thức bữa tối tại nhà hàng truyền thống Pháp.\r\n\r\nTự do khám phá Paris về đêm hoặc tham gia một tour thuyền trên sông Seine.\r\n\r\nNgày 4: Paris – Berlin (Đức)\r\nSáng:\r\n\r\nĂn sáng tại khách sạn, sau đó di chuyển đến sân bay để bay tới Berlin (khoảng 1 giờ 30 phút).\r\n\r\nTrưa:\r\n\r\nĐến Berlin, ăn trưa tại nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nTham quan Cổng Brandenburg – biểu tượng của sự thống nhất Đức.\r\n\r\nBức tường Berlin – tìm hiểu về lịch sử chia cắt nước Đức.\r\n\r\nTham quan Cung điện Charlottenburg và Đảo các bảo tàng (Museum Island).\r\n\r\nTối:\r\n\r\nThưởng thức bữa tối tại một nhà hàng Đức truyền thống.\r\n\r\nNghỉ đêm tại khách sạn ở Berlin.\r\n\r\nNgày 5: Berlin – Rome (Ý)\r\nSáng:\r\n\r\nĂn sáng tại khách sạn, di chuyển đến sân bay Berlin Tegel để bay đến Rome (khoảng 2 giờ bay).\r\n\r\nTrưa:\r\n\r\nĐến Rome, ăn trưa tại nhà hàng Ý nổi tiếng.\r\n\r\nChiều:\r\n\r\nTham quan Colosseum – đấu trường La Mã vĩ đại.\r\n\r\nTham quan Đấu trường La Mã và Di tích Roman Forum.\r\n\r\nQuảng trường Piazza Venezia và Đài tưởng niệm Vittorio Emanuele II.\r\n\r\nTối:\r\n\r\nDùng bữa tối tại một nhà hàng truyền thống với các món pasta, pizza hoặc gelato.\r\n\r\nNghỉ đêm tại khách sạn ở Rome.\r\n\r\nNgày 6: Rome – Khám phá thêm Rome\r\nSáng:\r\n\r\nTham quan Thánh đường St. Peter tại Vatican – nơi có Bức tường Sistine nổi tiếng.\r\n\r\nTham quan Vườn Vatican và Bảo tàng Vatican.\r\n\r\nTrưa:\r\n\r\nĂn trưa tại một nhà hàng địa phương ở khu vực Trastevere.\r\n\r\nChiều:\r\n\r\nDạo quanh Phố cổ Rome, tham quan Đài phun nước Trevi.\r\n\r\nTham quan Đài phun nước Tây Ban Nha và Quảng trường Navona.\r\n\r\nTối:\r\n\r\nThưởng thức bữa tối tại Trattoria hoặc một nhà hàng Ý truyền thống.\r\n\r\nNghỉ đêm tại khách sạn ở Rome.\r\n\r\nNgày 7: Rome – Mua sắm & Tự do\r\nSáng:\r\n\r\nTự do mua sắm tại Via del Corso, Spanish Steps, hoặc các khu mua sắm nổi tiếng.\r\n\r\nTrưa:\r\n\r\nDùng bữa trưa tại một nhà hàng địa phương.\r\n\r\nChiều:\r\n\r\nTự do tham quan thêm hoặc thư giãn tại một quán cà phê nổi tiếng.\r\n\r\nTối:\r\n\r\nChuyến bay trở về.\r\n\r\nNgày 8: Rời Rome\r\nSáng:\r\n\r\nDi chuyển ra sân bay Fiumicino hoặc Ciampino để bay về.\r\n\r\n🎁 Đặc sản nên mua trong Tour:\r\nAnh: Tea, Scone, Cà phê đen.\r\n\r\nPháp: Rượu vang Bordeaux, Bánh Macaron, Pho mát.\r\n\r\nĐức: Rượu vang Đức, Bia Đức, Sô cô la Đức.\r\n\r\nÝ: Rượu vang Ý, Dầu olive, Pasta tươi, Giày da Ý.', 1, 'Gia đình', '8 ngày 7 đêm', 58000000, 'Máy bay', 'Ngoài nước');
